import React from "react";
import "./App.css";
import Landing from "../pages/Landing";
require("dotenv").config();

const App = () => {
  return (
    <div className="wrapper">
      <Landing />
      <div>
        hello in this div there's an image
        {this.state.img && <img src={this.state.img} alt="" />}
      </div>
    </div>
  );
};

export default App;
